-- ----------------------------
-- Function structure for queryOrgChildren
-- ----------------------------
DROP FUNCTION IF EXISTS `queryOrgChildren`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `queryOrgChildren`(areaId VARCHAR(1000)) RETURNS varchar(4000) CHARSET utf8
BEGIN
	DECLARE sTemp VARCHAR(4000);
	DECLARE sTempChd VARCHAR(4000);
	
	SET sTemp = '$';
	SET sTempChd = cast(areaId as char);
	
	WHILE sTempChd is not NULL DO
	SET sTemp = CONCAT(sTemp,',',sTempChd);
	SELECT group_concat(id) INTO sTempChd FROM ieasy_sys_org where FIND_IN_SET(pid,sTempChd)>0;
	END WHILE;
	return sTemp;
END
;;
DELIMITER ;
